// ✅ HELPER FUNCTION
// Helper: Multilingual state/district name resolver
export const getTranslatedName = (englishName, language) => {
  if (!englishName) return 'Unknown';
  
  // STATE_TRANSLATIONS and DISTRICT_TRANSLATIONS must be imported or defined above
  const stateTranslation = STATE_TRANSLATIONS[englishName];
  const districtTranslation = DISTRICT_TRANSLATIONS[englishName];
  
  const translation = stateTranslation || districtTranslation;
  
  if (!translation) return englishName;
  if (!translation[language]) return englishName;
  return translation[language] || englishName;
};
